import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Dboard.css';

const Dboard = () => {
  const [locks, setLocks] = useState('');
  const [lockers, setLockers] = useState('');
  const [selectedLocker, setSelectedLocker] = useState(null);
  const [recipientName, setRecipientName] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [parcelDesc, setParcelDesc] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const savedLocks = localStorage.getItem('locks');
    const savedLockers = localStorage.getItem('lockers');

    if (savedLocks && savedLockers) {
      setLocks(savedLocks);
      setLockers(savedLockers);
    } else {
      navigate('/');
    }
  }, [navigate]);

  const handleLockerClick = (lockerId) => {
    setSelectedLocker(lockerId);
  };

  const handleAssign = () => {
    alert(`Parcel assigned to ${selectedLocker}!\nRecipient: ${recipientName}`);
    // Here you can store the parcel assignment to localStorage or send to backend
    setSelectedLocker(null);
    setRecipientName('');
    setPhoneNumber('');
    setParcelDesc('');
  };

  const handleCancel = () => {
    setSelectedLocker(null);
    setRecipientName('');
    setPhoneNumber('');
    setParcelDesc('');
  };

  const renderLockers = () => {
    const numLockers = parseInt(lockers) || 10;
    const lockerElements = [];

    for (let i = 1; i <= numLockers; i++) {
      lockerElements.push(
        <div key={i} className="locker-box" onClick={() => handleLockerClick(`L${i}`)}>
          L{i}
        </div>
      );
    }
    return lockerElements;
  };

  return (
    <div className="dashboard-container">
      <div className="nav-links">
        <a href="#">Dashboard</a> | <a href="#">Parcel History</a> | <a href="#">Logout</a>
      </div>

      <h2>
        Hello, <strong>[Watchman Name]</strong>, Welcome to <strong>[Hostel Name]</strong>!
      </h2>

      <div className="locker-container">{renderLockers()}</div>

      <div className="button-container">
        <button>Retrieve Parcel</button>
        <button>View Parcel History</button>
        <button>Logout</button>
      </div>

      <p>Contact Info: [Your Address], [Your Phone], [Your Email]</p>

      {selectedLocker && (
        <div className="modal-overlay">
          <div className="modal-content">
            <h3>Assign New Parcel to Locker {selectedLocker}</h3>
            <label>Recipient Name:</label>
            <input
              type="text"
              value={recipientName}
              onChange={(e) => setRecipientName(e.target.value)}
            />
            <label>Phone Number:</label>
            <input
              type="text"
              value={phoneNumber}
              onChange={(e) => setPhoneNumber(e.target.value)}
            />
            <label>Product ID / Parcel Description:</label>
            <input
              type="text"
              value={parcelDesc}
              onChange={(e) => setParcelDesc(e.target.value)}
            />
            <button onClick={handleAssign}>Assign Parcel</button>
            <button onClick={handleCancel}>Cancel</button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Dboard;
